import React from "react";
import './About.css';
import { useLocation } from 'react-router-dom';


function About() {
    const location = useLocation();
    console.log(useLocation);
    return (
        <div className="about__container">
            <span>
                About this page 
            </span>
        </div>
    );
    
}
export default About;
